import React, { useEffect, useState } from "react";

import Alt_Coffee_icon from '../../../../../1_image_or_icon/Alt_Coffee_icon.png'
import Alt_Restaurant_icon from '../../../../../1_image_or_icon/Alt_Restaurant_icon.png'
import Alt_Bar_icon from '../../../../../1_image_or_icon/Alt_Bar_icon.png'

import Pocket_Icon_Bar from '../../../../../1_image_or_icon/Pocket_icon_Bar.png'
import Pocket_Icon_Restaurant from '../../../../../1_image_or_icon/Pocket_icon_Restaurant.png'
import Pocket_Icon_Cafe from '../../../../../1_image_or_icon/Pocket_icon_Cafe.png'

export const NearbySearch_TabResults = (props) => {

    const [OnOff , updateToggle] = useState(props.places.map(()=>{
        return 'off'
    }))

    const LineExtense = () => {
        const LineExtense = document.getElementById('LocationSearch_filter_Container')
        LineExtense.style.height = 'fit-content'
    }

    const Place_Photo_Inspector = (input) => {
        switch(typeof input.photos){
            case('object'):
            return input.photos[0].getUrl()

            case('undefined'):

                switch(input.types[0]){
                    case('cafe'):
                    return Alt_Coffee_icon
                
                    case('restaurant'):
                    return Alt_Restaurant_icon
                    
                    case('bar'):
                    return Alt_Bar_icon
                }
        }
    }

    const Photo_Size_Inspector = (input) => {
        switch(typeof input.photos){
            case('object'):
            return 'cover'

            case('undefined'):
            return 'none'
        }
    }

    const Place_Pocket_Icon_Inspector = (input) => {
        switch(input.types[0]){
            case('cafe'):
            return Pocket_Icon_Cafe
        
            case('restaurant'):
            return Pocket_Icon_Restaurant
            
            case('bar'):
            return Pocket_Icon_Bar
        }
    }

    const Place_Reputation_Inspector = (input) => {
        const container = []
        
        switch(typeof input.rating){
            case('undefined'):
            return <span
            style={{
                backgroundColor: 'white',
                padding: '0 2vw'
            }}
            >
                No Reputation Yet
            </span>
        
            case('number'):
            for(let i=0; i<input.rating; i++){
                container.push("\u2B50")
            }
            return container.map((star)=>{
                return <span>{star}</span>
            })

            }
        }
    const TimeStamper = (input, index, onoff) => {
        switch(onoff){
            case('on'):
            switch(typeof input[index]){
                case('undefined'):
                return;

                case('object'):
                const weekday_text = input[index].weekday_text

                return weekday_text.map((day_timeline)=>{
                    return <React.Fragment>
                        <span>{day_timeline}</span>
                        <br></br>
                        </React.Fragment>
                })
            }

            case('off'):
            return;
        }
    }

    const IsOpen_Inspector = (input, index) => {
        switch(typeof input[index]){
            case('undefined'):
            return;

            case('object'):
            const condition = input[index].open_now

            switch(condition){
                case(true):
                return <React.Fragment>
                        <span>Is Opened </span>
                        <br></br>
                        </React.Fragment>

                case(false):
                return <React.Fragment>
                        <span>Is Closed </span>
                        <br></br>
                        </React.Fragment>
            }
        }
    }

    useEffect(()=>{
       LineExtense()
       console.log(props.timestamp)
    },[])

    return <React.Fragment>

    <div
    style={{
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        padding: ' 0 0 4vh 5vw',
        margin: '4vh 0'
    }}>


    {props.places.map((place)=>{

        return <div
        style={{
            width: '45vw',
            height: '30vh',
            border: 'black solid 5px',
            borderRadius: '20px',
            margin: '2vh 0',
            display: 'flex',
            flexDirection: 'column',
            justifyContent: 'space-between',
            paddingBottom: '2vh'
        }}>
            <img
            src={Place_Photo_Inspector(place)}
            style={{
                width: '44vw',
                height: '15vh',
                borderRadius: '15px',
                border: 'white solid 2px',
                objectFit: Photo_Size_Inspector(place),
                backgroundColor: '#dfdfdf'
            }}
            ></img>
            
                

                <span
                className="Places_Information_TextSection"
                style={{
                    fontSize: '5vw',
                    marginTop: '1vh',
                    textWrap: 'nowrap'
                }}
                >
                    {place.name.split(' ').map((str)=>{

                        if(str.length>12){
                        return <React.Fragment>
                            <span>{str.substr(0,6)}</span>
                            <br></br>
                            <span>{str.substr(6)}</span>
                            </React.Fragment>
                        }

                        return <React.Fragment>
                            <span>{str}</span>
                            <br></br>
                            </React.Fragment>
                    })}
                </span>

                <img
                src={Place_Pocket_Icon_Inspector(place)}
                className="Places_Information_TextSection"
                style={{
                    position:'absolute',
                    right: '11.5vw',
                    marginTop: '16.5vh',
                    width: '6vw'
                }}
                
                ></img>

                <span
                 className="Places_Information_TextSection"
                >
                    {Place_Reputation_Inspector(place)}
                </span>

                <span
                 className="Places_Information_TextSection"
                 style={{
                    fontSize: '3vw',
                    paddingTop: '1vh'
                 }}
                >
                    {place.vicinity}
                    
                </span>
                
                <span
                className="Places_Information_TextSection"

                style={{
                    position: 'absolute',
                    marginTop: '28vh',
                    textAlign: 'left',
                    backgroundColor: 'white',
                    lineHeight: '2.2vh'
                }}

                onClick={()=>{
                  
                    const TogglePoint = OnOff[props.places.indexOf(place)]
                  
                    switch(TogglePoint){
                        case('on'): 
                        OnOff[props.places.indexOf(place)] = 'off'
                        updateToggle([...OnOff])
                        console.log(OnOff)
                        return;

                        case('off'):
                        OnOff[props.places.indexOf(place)] = 'on'
                        updateToggle([...OnOff])
                        console.log(OnOff)
                        return;
                    }
                
                   
                // OnOff[props.places.indexOf(place)] = 'on'
                    
                   
                }}
                >
                    
                {IsOpen_Inspector(props.timestamp, props.places.indexOf(place))}

                {TimeStamper(props.timestamp, props.places.indexOf(place),OnOff[props.places.indexOf(place)])}
                </span>

                <br></br>

            

        </div>
    })}

    </div>

    </React.Fragment>

}

export default NearbySearch_TabResults;
